這天的我來到迪士尼，
34歲大叔像個10歲小
孩一樣興奮在迪士尼裡
面小躍步走著，那心情
因該很難忘記
.
在2020/9/4這天我問我
媽你明年什麼時候退休
她說大概四月吧，我說
明年我跟弟弟送你一份
退休禮物，她一臉開心
問我是什麼，我說小時
後你總是說要帶我們去
迪士尼這次我們去實現
他吧，這次疫情結束我
帶妳去東京迪士尼要嗎
，她開心說著好啊！
.
前幾年帶她去一趟關西
之旅她開心像個小朋友
那個笑容我會珍惜，這
幾年辛苦了
.
